let thsOfTitle=document.getElementsByClassName('ant-table-thead')[0].getElementsByTagName('th');let arrOfTitles=[];for(let i=0;i<thsOfTitle.length;i++){let tempH;if(i>0&&thsOfTitle[i-1].innerText.trim()===thsOfTitle[i].innerText.trim()){tempH=thsOfTitle[i-1].innerText.trim()+'_重名标题'}else{tempH=thsOfTitle[i].innerText.trim()}arrOfTitles.push(tempH)}let trsOfDataRow=document.getElementsByClassName('ant-table-tbody')[0].getElementsByTagName('tr');let arrOfDataRows=[];for(let i=0;i<trsOfDataRow.length;i++){let tdsOfCurrentTr=trsOfDataRow[i].getElementsByTagName('td');let tempObj={};for(let j=0;j<tdsOfCurrentTr.length;j++){let tempContent=tdsOfCurrentTr[j].innerText.trim();if(tempContent.toString().length>0){tempObj[arrOfTitles[j]]=tempContent}else{tempObj[arrOfTitles[j]]='列<'+(j+1).toString()+'>'}}arrOfDataRows.push(tempObj)}let resultStr='';for(let i=0;i<arrOfTitles.length;i++){if(i<arrOfTitles.length-1){resultStr+=arrOfTitles[i]+'\t'}else{resultStr+=arrOfTitles[i]+'\n'}}for(let i=0;i<arrOfDataRows.length;i++){let keys=Object.keys(arrOfDataRows[i]);let values=Object.values(arrOfDataRows[i]);for(let j=0;j<keys.length;j++){if(j<keys.length-1){resultStr+=values[j]+'\t'}else{resultStr+=values[j]}}if(i<arrOfDataRows.length-1){resultStr+='\n'}}console.log(resultStr);